import * as React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import CircularProgress from '@mui/material/CircularProgress';
import { Container, Typography, Button} from '@mui/material';
import testImage from './assets/1.png';

export default function ImageWindow(props){
    //console.log('Imagewindow: '+ props.uploadStatus)
    const thisImage = props.thisImage
    const thisMask = props.thisMask
    const uploadStatus = props.uploadStatus

    return(
        <Container maxWidth='lg' fixed>
            <Box 
                width={'100%'}
                height={500}
                display="flex" 
                alignItems="center"
                justifyContent="center"
                sx={{backgroundColor: 'secondary.main',
                    borderRadius: 3,
                    border: 1,
                    borderStyle: 'solid'
                }}>
                <CenterItem uploadStatus={uploadStatus} thisImage={thisImage} thisMask={thisMask} />
                
            </Box>
        </Container>
    );    
}


function CenterItem(props){
    if (props.uploadStatus === "not_uploaded"){
        return(
            <Typography>output image preview will be shown here after uploading.</Typography>
        );
    }else if (props.uploadStatus === "processing"){
        return(
            <CircularProgress color="primary" />
        );
    }else{
        return(
            <Container maxWidth='xl'>
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <img src={props.thisImage} style={{margin: 10}}width={450} height={400}></img>
                    {/* <Box sx={{width: 475, height: 400}} backgroundImage={testImage} position='relative'/> */}
                </Grid>
                <Grid item xs={6}>
                    <img src={props.thisMask.data} style={{margin: 10}} width={450} height={400} ></img>
                    {/* <Box sx={{width: 475, height: 400}} backgroundImage={testImage} position='relative'/> */}
                </Grid>
            </Grid>

            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <Button variant="outlined" fullWidth>Previous Image</Button>
                </Grid>
                <Grid item xs={6}>
                    <Button variant="outlined" fullWidth>Next Image</Button>
                </Grid>
            </Grid>
            </Container>
            
        )
    }
}
